import React from "react";
import { useNavigate } from "react-router-dom";

function Login() {
  let Navigate = useNavigate;

  Navigate.push("./sample");
  return (
    <div>
      <input type="text" placeholder="username" />
      <input type="text" placeholder="password" />
      <button
        onClick={() => {
          Navigate.push("./sample");
        }}
      >
        Login
      </button>
    </div>
  );
}

export default Login;
